import NavBar from "../components/nav-bar"
import {  Content } from "../components";
import { Redirect } from "react-router-dom";
const Home = ({authorized}) => {
  if(!authorized)
  {
     return <Redirect to="/"/>
  }
  <Fragment>
    <NavBar />
    {/* <Hero />
    <hr /> */}
    <Content />
    
  </Fragment>
};

export default Home;
